from tqdm import tqdm
import random
import math
import random
import math
import mindspore
import mindspore.nn as nn
import x2ms_adapter
import x2ms_adapter.torch_api.nn_api.nn as x2ms_nn


class BaseClass(nn.Cell):
    def __init__(self):
        super(BaseClass, self).__init__()
        self.cur_itr = mindspore.Parameter(x2ms_adapter.x2ms_tensor(0, dtype=mindspore.int32), requires_grad=False)
        self.best_mrr = mindspore.Parameter(x2ms_adapter.x2ms_tensor(0, dtype=mindspore.float64), requires_grad=False)
        self.best_itr = mindspore.Parameter(x2ms_adapter.x2ms_tensor(0, dtype=mindspore.int32), requires_grad=False)


class HyperNet(BaseClass):
    def __init__(self, dataset, emb_dim, hidden_drop):
        super(HyperNet, self).__init__()
        self.emb_dim = emb_dim
        self.dataset = dataset
        self.E = x2ms_nn.Embedding(dataset.num_ent, emb_dim, padding_idx=0)
        self.R = x2ms_nn.Embedding(dataset.num_rel, emb_dim, padding_idx=0)
        self.W02 = mindspore.Parameter(x2ms_adapter.empty(size=(3*emb_dim, 200)))
        self.W03 = mindspore.Parameter(x2ms_adapter.empty(size=(3*emb_dim, 200)))
        self.W04 = mindspore.Parameter(x2ms_adapter.empty(size=(3*emb_dim, 200)))
        self.W05 = mindspore.Parameter(x2ms_adapter.empty(size=(3*emb_dim, 200)))
        self.W06 = mindspore.Parameter(x2ms_adapter.empty(size=(3*emb_dim, 200)))
        self.W1 = mindspore.Parameter(x2ms_adapter.empty(size=(2*emb_dim, 200)))
        self.W2 = mindspore.Parameter(x2ms_adapter.empty(size=(emb_dim, 200)))
        self.W3 = mindspore.Parameter(x2ms_adapter.empty(size=(emb_dim, 200)))

        self.a2 = mindspore.Parameter(x2ms_adapter.empty(size=(200, 1)))
        self.a3 = mindspore.Parameter(x2ms_adapter.empty(size=(200, 1)))
        self.a4 = mindspore.Parameter(x2ms_adapter.empty(size=(200, 1)))
        self.a5 = mindspore.Parameter(x2ms_adapter.empty(size=(200, 1)))
        self.a6 = mindspore.Parameter(x2ms_adapter.empty(size=(200, 1)))
        x2ms_adapter.nn_init.xavier_normal_(self.E.weight.data)
        x2ms_adapter.nn_init.xavier_normal_(self.R.weight.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W02.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W03.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W04.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W05.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W06.data)
        x2ms_adapter.nn_init.xavier_normal_(self.a2.data)
        x2ms_adapter.nn_init.xavier_normal_(self.a3.data)
        x2ms_adapter.nn_init.xavier_normal_(self.a4.data)
        x2ms_adapter.nn_init.xavier_normal_(self.a5.data)
        x2ms_adapter.nn_init.xavier_normal_(self.a6.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W1.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W2.data)
        x2ms_adapter.nn_init.xavier_normal_(self.W3.data)
        self.hidden_drop_rate = hidden_drop
        self.hidden_drop = x2ms_nn.Dropout(self.hidden_drop_rate)
        self.leakyrelu = x2ms_nn.LeakyReLU(0.2)


        self.in_channels = 1
        self.out_channels = 5
        self.filt_h = 1
        self.filt_w = 1
        self.stride = 2

        self.max_arity = 4


        self.bn0 = x2ms_nn.BatchNorm2d(self.in_channels)
        self.inp_drop = x2ms_nn.Dropout(0.2)

        fc_length = (1-self.filt_h+1)*x2ms_adapter.tensor_api.floor(math, (emb_dim-self.filt_w)/self.stride + 1)*self.out_channels

        self.bn2 = x2ms_nn.BatchNorm1d(fc_length)
        # Projection network
        self.fc = x2ms_nn.Linear(fc_length, emb_dim)
        self.device = x2ms_adapter.Device('cuda:0' if x2ms_adapter.is_cuda_available() else 'cpu')

        # size of the convolution filters outputted by the hypernetwork
        fc1_length = self.in_channels*self.out_channels*self.filt_h*self.filt_w
        # Hypernetwork
        self.fc1 = x2ms_nn.Linear(emb_dim + self.max_arity + 1, fc1_length) # (306, 5)
        self.fc2 = x2ms_nn.Linear(self.max_arity + 1, fc1_length) # (6, 5)


    def er_pos_emb(self, r_emb, e_emb):
        return x2ms_adapter.mm(x2ms_adapter.cat((r_emb, e_emb), dim=1), self.W1)


    def convolve(self, r, ei, pos):

        e = x2ms_adapter.tensor_api.view(ei, -1, 1, 1, x2ms_adapter.tensor_api.x2ms_size(self.E.weight, 1))
        x = e
        x = self.inp_drop(x)
        one_hot_target = x2ms_adapter.to(x2ms_adapter.tensor_api.x2ms_float((pos == x2ms_adapter.arange(self.max_arity + 1).reshape(self.max_arity + 1))), self.device)
        poses = x2ms_adapter.tensor_api.view(x2ms_adapter.tensor_api.repeat(one_hot_target, r.shape[0]), -1, self.max_arity + 1)
        one_hot_target.requires_grad = False
        poses.requires_grad = False
        k = self.fc2(poses)
        k = x2ms_adapter.tensor_api.view(k, -1, self.in_channels, self.out_channels, self.filt_h, self.filt_w)
        k = x2ms_adapter.tensor_api.view(k, x2ms_adapter.tensor_api.x2ms_size(e, 0)*self.in_channels*self.out_channels, 1, self.filt_h, self.filt_w)
        x = x2ms_adapter.tensor_api.permute(x, 1, 0, 2, 3)
        x = x2ms_adapter.nn_functional.conv2d(x, k, stride=self.stride, groups=x2ms_adapter.tensor_api.x2ms_size(e, 0))
        x = x2ms_adapter.tensor_api.view(x, x2ms_adapter.tensor_api.x2ms_size(e, 0), 1, self.out_channels, 1-self.filt_h+1, -1)
        x = x2ms_adapter.tensor_api.permute(x, 0, 3, 4, 1, 2)
        x = x2ms_adapter.x2ms_sum(x, dim=3)
        x = x2ms_adapter.tensor_api.contiguous(x2ms_adapter.tensor_api.permute(x, 0, 3, 1, 2))
        x = x2ms_adapter.tensor_api.view(x, x2ms_adapter.tensor_api.x2ms_size(e, 0), -1)
        x = self.fc(x)
        return x

    def construct(self, batch, ms, bs):
        r_idx = batch[:, 0]
        r = self.R(r_idx)

        if batch.shape[1] == 3:

            e1 = self.convolve(r, self.E(batch[:, 1]), 0) * x2ms_adapter.tensor_api.view(ms[:,0], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,0], -1, 1)
            e2 = self.convolve(r, self.E(batch[:, 2]), 1) * x2ms_adapter.tensor_api.view(ms[:,1], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,1], -1, 1)

            e12 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e2, r), dim=1), self.W02)
            e21 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e1, r), dim=1), self.W02)

            e1_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a2))) / x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a2)))
            e2_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a2))) / x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a2)))


            new_e1 = x2ms_adapter.mm(e1, self.W2) + x2ms_adapter.tanh(e12*e1_e2_att)
            new_e2 = x2ms_adapter.mm(e2, self.W2) + x2ms_adapter.tanh(e21*e2_e1_att)


            e = new_e1 * new_e2 * r

        elif batch.shape[1] == 4:
            e1 = self.convolve(r, self.E(batch[:, 1]), 0) * x2ms_adapter.tensor_api.view(ms[:,0], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,0], -1, 1)
            e2 = self.convolve(r, self.E(batch[:, 2]), 1) * x2ms_adapter.tensor_api.view(ms[:,1], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,1], -1, 1)
            e3 = self.convolve(r, self.E(batch[:, 3]), 2) * x2ms_adapter.tensor_api.view(ms[:,2], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,2], -1, 1)
            e12 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e2, r), dim=1), self.W03)
            e13 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e3, r), dim=1), self.W03)
            e21 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e1, r), dim=1), self.W03)
            e23 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e3, r), dim=1), self.W03)
            e31 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e1, r), dim=1), self.W03)
            e32 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e2, r), dim=1), self.W03)

            e1_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a3))))
            e1_e3_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a3))))
            e2_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a3))))
            e2_e3_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a3))))
            e3_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a3))))
            e3_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a3))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a3))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a3))))


            new_e1 = x2ms_adapter.mm(e1, self.W2) + x2ms_adapter.tanh(e12*e1_e2_att + e13*e1_e3_att)
            new_e2 = x2ms_adapter.mm(e2, self.W2) + x2ms_adapter.tanh(e21*e2_e1_att + e23*e2_e3_att)
            new_e3 = x2ms_adapter.mm(e3, self.W2) + x2ms_adapter.tanh(e31*e3_e1_att + e32*e3_e2_att)


            e = new_e1 * new_e2 * new_e3 * r

        elif batch.shape[1] == 5:
            e1 = self.convolve(r, self.E(batch[:, 1]), 0) * x2ms_adapter.tensor_api.view(ms[:,0], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,0], -1, 1)
            e2 = self.convolve(r, self.E(batch[:, 2]), 1) * x2ms_adapter.tensor_api.view(ms[:,1], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,1], -1, 1)
            e3 = self.convolve(r, self.E(batch[:, 3]), 2) * x2ms_adapter.tensor_api.view(ms[:,2], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,2], -1, 1)
            e4 = self.convolve(r, self.E(batch[:, 4]), 3) * x2ms_adapter.tensor_api.view(ms[:,3], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,3], -1, 1)


            e12 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e2, r), dim=1), self.W04)
            e13 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e3, r), dim=1), self.W04)
            e14 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e4, r), dim=1), self.W04)
            e21 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e1, r), dim=1), self.W04)
            e23 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e3, r), dim=1), self.W04)
            e24 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e4, r), dim=1), self.W04)
            e31 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e1, r), dim=1), self.W04)
            e32 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e2, r), dim=1), self.W04)
            e34 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e4, r), dim=1), self.W04)
            e41 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e1, r), dim=1), self.W04)
            e42 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e2, r), dim=1), self.W04)
            e43 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e3, r), dim=1), self.W04)

            e1_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e14, self.a4))))
            e1_e3_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e14, self.a4))))
            e1_e4_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e14, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e12, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e13, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e14, self.a4))))
            e2_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e24, self.a4))))
            e2_e3_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e24, self.a4))))
            e2_e4_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e24, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e21, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e23, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e24, self.a4))))
            e3_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e34, self.a4))))
            e3_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e34, self.a4))))
            e3_e4_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e34, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e32, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e34, self.a4))))
            e4_e1_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e41, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e42, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e43, self.a4))))
            e4_e2_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e42, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e42, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e43, self.a4))))
            e4_e3_att = x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e43, self.a4))) / (x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e31, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e42, self.a4))) + x2ms_adapter.exp(self.leakyrelu(x2ms_adapter.mm(e43, self.a4))))

            new_e1 = x2ms_adapter.mm(e1, self.W2) + x2ms_adapter.tanh(e12 * e1_e2_att + e13 * e1_e3_att + e14 * e1_e4_att)
            new_e2 = x2ms_adapter.mm(e2, self.W2) + x2ms_adapter.tanh(e21 * e2_e1_att + e23 * e2_e3_att + e24 * e2_e4_att)
            new_e3 = x2ms_adapter.mm(e3, self.W2) + x2ms_adapter.tanh(e31 * e3_e1_att + e32 * e3_e2_att + e34 * e3_e4_att)
            new_e4 = x2ms_adapter.mm(e4, self.W2) + x2ms_adapter.tanh(e41 * e4_e1_att + e42 * e4_e2_att + e43 * e4_e3_att)


            e = new_e1 * new_e2 * new_e3 * new_e4 * r


        elif batch.shape[1] == 6:
            e1 = self.convolve(r, self.E(batch[:, 1]), 0) * x2ms_adapter.tensor_api.view(ms[:,0], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,0], -1, 1)
            e2 = self.convolve(r, self.E(batch[:, 2]), 1) * x2ms_adapter.tensor_api.view(ms[:,1], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,1], -1, 1)
            e3 = self.convolve(r, self.E(batch[:, 3]), 2) * x2ms_adapter.tensor_api.view(ms[:,2], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,2], -1, 1)
            e4 = self.convolve(r, self.E(batch[:, 4]), 3) * x2ms_adapter.tensor_api.view(ms[:,3], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,3], -1, 1)
            e5 = self.convolve(r, self.E(batch[:, 5]), 4) * x2ms_adapter.tensor_api.view(ms[:,4], -1, 1) + x2ms_adapter.tensor_api.view(bs[:,4], -1, 1)

            e12 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e2, r), dim=1), self.W05)
            e13 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e3, r), dim=1), self.W05)
            e14 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e4, r), dim=1), self.W05)
            e15 = x2ms_adapter.mm(x2ms_adapter.cat((e1, e5, r), dim=1), self.W05)
            e21 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e1, r), dim=1), self.W05)
            e23 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e3, r), dim=1), self.W05)
            e24 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e4, r), dim=1), self.W05)
            e25 = x2ms_adapter.mm(x2ms_adapter.cat((e2, e5, r), dim=1), self.W05)
            e31 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e1, r), dim=1), self.W05)
            e32 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e2, r), dim=1), self.W05)
            e34 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e4, r), dim=1), self.W05)
            e35 = x2ms_adapter.mm(x2ms_adapter.cat((e3, e5, r), dim=1), self.W05)
            e41 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e1, r), dim=1), self.W05)
            e42 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e2, r), dim=1), self.W05)
            e43 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e3, r), dim=1), self.W05)
            e45 = x2ms_adapter.mm(x2ms_adapter.cat((e4, e5, r), dim=1), self.W05)
            e51 = x2ms_adapter.mm(x2ms_adapter.cat((e5, e1, r), dim=1), self.W05)
            e52 = x2ms_adapter.mm(x2ms_adapter.cat((e5, e2, r), dim=1), self.W05)
            e53 = x2ms_adapter.mm(x2ms_adapter.cat((e5, e3, r), dim=1), self.W05)
            e54 = x2ms_adapter.mm(x2ms_adapter.cat((e5, e4, r), dim=1), self.W05)



